import { FaBell, FaBars } from 'react-icons/fa';

export default function MobileNavbar() {
  return (
    <nav className="bg-white px-4 py-3 flex justify-between items-center shadow-sm md:hidden">
      {/* GAUCHE : Menu Burger */}
      <div className="flex items-center">
        <FaBars className="text-2xl text-gray-800" />
      </div>

      {/* DROITE : Notification + Profil - Alignement horizontal */}
      <div className="flex items-center gap-3">
        {/* Notification - Cercle avec badge */}
        <div className="relative flex items-center justify-center">
          <div className="w-9 h-9 flex items-center justify-center bg-white rounded-full shadow-sm">
            <FaBell className="text-lg text-gray-600" />
          </div>
          <span className="absolute top-1 right-1 w-2 h-2 bg-cyan-500 rounded-full"></span>
        </div>

        {/* Profil - Petit cercle avec petite image centr√©e */}
        <div className="w-7 h-7 rounded-full bg-white shadow-sm flex items-center justify-center">
          <img
            src=""
            alt="Profil"
            className="w-5 h-5 rounded-full object-cover"
          />
        </div>
      </div>
    </nav>
  );
}
